import React from 'react';
import './App.css';

import ScrenDisplay from './components/ScreenDisplay'
import Display from './components/Display';

function App() {
  return (
	<>
    <div className="App">
		<ScrenDisplay></ScrenDisplay>
		<Display></Display>
    </div>
	</>
  );
}

export default App;
